import './App.css';

function App() {
  return (
    <div className="App">
      <header className="app-header">
        <h1 className="main-title">Futurite</h1>
        <p className="subheading">Empowering You for the Future of Learning</p>
        <p className="tagline">Innovative tools and strategies designed to enhance your learning experience.</p>
      </header>
      <main>
        <section className="intro-section">
          <h2 className="highlighted">Ready to unlock your future?</h2>
          <p>Start your journey with Futurite and take your learning to the next level. Discover new ways to achieve your goals.</p>
        </section>
      </main>
    </div>
  );
}

export default App;
